<script lang="ts">
import { Options, Vue } from 'vue-class-component';
import { isUndefined } from 'lodash-es';
import gsap from 'gsap';

class Props {
  bearing?: number;

  distance?: number;
}

@Options({
  watch: {
    displayedBearing(): void {
      gsap.to(this, { duration: 0.5, ease: 'linear', tweenedBearing: this.displayedBearing });
    },

    bearing(): void {
      if (isUndefined(this.bearing)) this.spinPointer();
      else this.stopSpinning();
    },
  },
})
export default class ADFView extends Vue.with(Props) {
  private animationTimeout?: NodeJS.Timer;

  private spin?: gsap.core.Tween;

  private displayedBearing = this.bearing || 0;

  private tweenedBearing = this.bearing || 0;

  declare $refs: {
    pointer: SVGPolygonElement;
  };

  get transformPointer(): string {
    return `translate(48.291199, 48.186742) rotate(${this.tweenedBearing}) translate(-48.291199, -48.186742)`;
  }

  private get inaccuracy(): number { // degrees
    if (isUndefined(this.distance)) return 0;

    const calcInaccuracy = 0.15 * this.distance + 2;
    if (calcInaccuracy > 10) return 10;
    if (calcInaccuracy < 3) return 3;
    return calcInaccuracy;
  }

  mounted(): void {
    this.animationTimeout = setInterval(() => this.animatePointer(), 500);
    if (isUndefined(this.bearing)) this.spinPointer();
  }

  destroyed(): void {
    if (!isUndefined(this.animationTimeout)) {
      clearInterval(this.animationTimeout);
      this.animationTimeout = undefined;
    }
    this.stopSpinning();
  }

  animatePointer(): void {
    if (isUndefined(this.bearing)) return;
    let additive = Math.random() * this.inaccuracy;
    if (Math.random() < 0.5) additive *= -1;
    this.displayedBearing = this.bearing! + additive;
  }

  spinPointer(): void {
    if (!isUndefined(this.spin)) return;

    this.spin = gsap.to(this.$refs.pointer, {
      rotation: 360,
      duration: 2,
      ease: 'none',
      transformOrigin: 'center',
      repeat: -1,
    });
  }

  stopSpinning(): void {
    if (isUndefined(this.spin)) return;

    this.spin.kill();
    this.spin = undefined;
  }
}
</script>

